import React from 'react';

export default function TodoList({ todoList }) {
  return (
    <div>
      <div>My Todolist</div>
      {todoList.map((todo) => (
        <div style={{ display: 'flex' }}>
          <input type='checkbox' />
          <div>{todo.content}</div> <button>삭제</button>
        </div>
      ))}
    </div>
  );
}
